import React from "react";
import './card-list.style.css';

export const CardList = props =>{
    console.log('cardlistcomponent');
    return <div className="card-list">
        {props.monsters.map((monster, index) => (
            <h1 key={index}>{monster.name}</h1>
          ))}
    </div>
}
